import (
	"context"
	"fmt"
	"os"
	"os/signal"
	"strings"

	"github.com/jackc/pgconn"
	"github.com/jackc/pgproto3/v2"
)

func main() {
	ctx, cancel := signal.NotifyContext(context.Background(), os.Interrupt)
	defer cancel()

	conn, err := pgconn.Connect(ctx, "postgresql://root@localhost:26257/defaultdb?sslmode=disable")
	if err != nil {
		fmt.Fprintf(os.Stderr, "connect failed: %v\n", err)
		os.Exit(1)
	}
	defer conn.Close(ctx)
	buf, _ := (&pgproto3.Query{String: "SUBSCRIBE TO SELECT * FROM test "}).Encode(nil)
	conn.SendBytes(ctx, buf)

	fmt.Println("Streaming started...")

	var columns []string

	for {
		msg, err := conn.ReceiveMessage(ctx)
		if err != nil {
			fmt.Fprintf(os.Stderr, "receive error: %v\n", err)
			break
		}

		switch m := msg.(type) {
		case *pgproto3.RowDescription:
			// Get column names
			columns = make([]string, len(m.Fields))
			for i, field := range m.Fields {
				columns[i] = string(field.Name)
			}
			fmt.Printf("Columns: %s\n", strings.Join(columns, ", "))

		case *pgproto3.DataRow:
			// Print all column values
			values := make([]string, len(m.Values))
